I fixed the itemscope hashcode collision problem documented in ANY23-339, as well as loosening the restriction on subject resources to allow absolute URIs as subjects. 

mvn clean test --> all tests pass

@lewismc Any comments before I merge this?

This should resolve the remaining problems with the Nutch test cases.

mvn clean test --> all tests pass.

@lewismc any comments?

This is my first stab at removing the decade-out-of-date `commons-httpclient` dependency.

All tests are passing, but I want another set of eyes on this.

@lewismc any comments?

User JSON-LD as a default JSONWritter.

Having the statement:
```xml
<http://sub/1> <http://pred/1> "123"^^<http://datatype> <http://graph/1>.
```

Before using the default RDF4J writer:
```json
[
  {
    "type": "uri",
    "value": "http://sub/1"
  },
  "http://pred/1",
  {
    "type": "literal",
    "value": "123",
    "lang": null,
    "datatype": "http://datatype"
  },
  "http://graph/1"
]
```

Now, using the RDF4J writer:
```json
[
  {
    "@graph": [
      {
        "@id": "http://sub/1",
        "http://pred/1": [
          {
            "@type": "http://datatype",
            "@value": "123"
          }
        ]
      }
    ],
    "@id": "http://graph/1"
  }
]
```

I am wondering about name conventions and some drawback compatibility. 
- Should we rename the classes `JSONWriter` to `JSONLDWriter` and `JSONWriterFactory` to `JSONLDWriterFactory`. 
- When using the REST API, should we use `jsonld` as output format  instead of `json`.

Closes #ANY231 [issue](https://issues.apache.org/jira/browse/ANY23-231)

My solution to this problem was to strip all xml namespaces from attributes and tag names except the "xml:" and "xmlns:" namespaces. I also added a test case.

mvn clean test -> all tests pass

@lewismc any comments?

For string literals of datatype "langString" with no language tag, I'm simply falling back to type "string" (or using the default language if specified).

mvn clean test -> all tests pass

@lewismc any comments?
